import { useDispatch } from 'react-redux';
import { addToCart } from '../features/cartSlice';

const FoodCard = ({ food }) => {
  const dispatch = useDispatch();

  return (
    <div className="bg-white rounded-xl shadow-lg hover:shadow-xl transition-shadow p-6">
      <img 
        src={food.image || 'https://via.placeholder.com/300x200?text=Food'} 
        alt={food.name} 
        className="w-full h-48 object-cover rounded-lg mb-4" 
      />
      <h3 className="text-xl font-semibold mb-2">{food.name}</h3>
      <p className="text-gray-600 mb-3">{food.description || 'Delicious food item'}</p>
      <div className="flex justify-between items-center mb-4">
        <span className="text-2xl font-bold text-orange-500">â‚¹{food.price}</span>
        <button
          onClick={() => dispatch(addToCart(food))}
          className="bg-orange-500 text-white px-6 py-2 rounded-lg hover:bg-orange-600 transition-colors"
        >
          Add to Cart
        </button>
      </div>
    </div>
  );
};

export default FoodCard;
